import React, {useState} from 'react'
import './App.css';

function App() {

  const [good, setGood] = useState(0)
  const [neutral, setNeutral] = useState(0)
  const [bad, setBad] = useState(0)

  let all = good+neutral+bad
  let average = (good-bad)/all
  let positive = good*100/all

  return (
    <div className="App">
      <h3>Give Feedback:</h3>
      <button onClick={()=>{setGood(good+1)}}>Good</button><br/>
      <button onClick={()=>{setNeutral(neutral+1)}}>Neutral</button><br/>
      <button onClick={()=>{setBad(bad+1)}}>Bad</button><br/>
      <h3>Statistics</h3>
      Good: {good}<br/>
      Neutral: {neutral}<br/>
      Bad: {bad}<br/>
      All: {all}<br/>
      Average: {average}<br/>
      Positive: {positive}%<br/>
    </div>
  );
}

export default App;
